      SELECT ALL col0 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT ( ( + col1 ) ) + - col2 * col1 / - 17 NOT IN ( - 50 + + + col0 + + + ( + col0 ) );
  - name: tab0

outputs:
  - name: q13089.out
    data: |
